      _push(`</div><article class="flex flex-col mt-10 max-w-[90%] sm:ml-14 ml-5" data-v-7d70c62b><h3 class="text-left w-full m-[0px]" data-v-7d70c62b>Stigende grundvand kr\xE6ver nye veje \u2013 i tanke og i praksis</h3><h4 class="mt-5 mb-0" data-v-7d70c62b>Efter et \xE5r med rekordh\xF8je nedb\xF8rsm\xE6ngder er det blevet tydeligt for enhver, at der kr\xE6ves nyt\xE6nkning i forbindelse med vedligeholdelse af de danske grus- og jordveje.</h4><div class="w-full flex flex-col sm:flex-row mt-10 gap-10" data-v-7d70c62b><div class="flex flex-col gap-5 sm:max-w-[55%]" data-v-7d70c62b><p data-v-7d70c62b>Grusvej.dk m\xF8der udfordringen hver eneste dag. Firmaet, som er specialister i etablering og vedligehold af grus- og jordveje, har aldrig oplevet s\xE5 vandfyldt et terr\xE6n, som det der m\xF8der maskiner og mandskab. Uanset om det er skovveje, private veje, i sommerhusomr\xE5der eller ved ny anl\xE6g af grus-, jord- eller s\xE5gar asfaltveje.</p><h5 class="" data-v-7d70c62b>Forklaringen er grundvand som pipler frem som aldrig f\xF8r</h5><p class="" data-v-7d70c62b>Grundvandet i det meste af Danmark st\xE5r lige nu s\xE5 h\xF8jt som aldrig f\xF8r. De rekordstore m\xE6ngder nedb\xF8r i vinter og for\xE5r har m\xE6ttet de \xF8verste jordlag, s\xE5 grundvandet st\xE5r 40 cm over normalt niveau. Det er et problem her og nu p\xE5 mange str\xE6kninger med grus- eller jordveje og det bliver sandsynligvis kun v\xE6rre. Fordi vandet st\xE5r s\xE5 h\xF8jt som nu, er der tilsvarende mindre plads til at absorbere de kommende m\xE5neders forventede efter\xE5rsregn. <br data-v-7d70c62b><br data-v-7d70c62b> P\xE5 den lange bane forventer GEUS, som er statens geologiske videnscenter, at grundvandet generelt kan stige op til 27 cm frem mod slutningen af dette \xE5rhundrede. Danmarks Meterologiske Institut har tilsvarende beregnet, at vi i samme periode vil opleve \xF8get nedb\xF8r p\xE5 mellem 6% og 12 % hen over efter\xE5r/vinter. Vandm\xE6ngderne stiger s\xE5ledes b\xE5de fra neden og fra oven.</p><h5 data-v-7d70c62b>Vejene nedbrydes hurtigt</h5><p data-v-7d70c62b>I mange skov-, sommerhus- og landomr\xE5der er de gamle veje ikke konstrueret til at modst\xE5 nutidens vandpres. Mange af disse veje er oprindeligt anlagt som simple hjulspor, da byernes velhavende borgere etablerede sommerresidenser p\xE5 \u201Dfeddet\u201D. Enkle jordveje uden den forn\xF8dne b\xE6reevne, eventuelt fors\xF8gt styrket med sten og forh\xE5ndenv\xE6rende byggeaffald, s\xE5som beton- og murbrokker. <br data-v-7d70c62b> <br data-v-7d70c62b> Denne primitive fundering kan fysisk ikke holde b\xE6relaget oppe, n\xE5r der tilf\xF8res store regnm\xE6ngder og falder derfor, bogstavelig talt, sammen eller skylles v\xE6k. Underlaget opbl\xF8des fordi vandet ikke afledes korrekt. Herved kommer de gamle brokker og sten frem i stedet, hvilket vores moderne biler ikke har godt af og k\xF8rekomforten bliver desuden meget forringet. Til sidst vil det v\xE6re umuligt at f\xE6rdes p\xE5 den nedbrudte vej.</p><h5 data-v-7d70c62b>Hvad kan vi g\xF8re for at sikre vores veje</h5><p data-v-7d70c62b>\u201DL\xF8sningen kaldes opklassificering\u201D, fort\xE6ller Lars-Henrik Jensen fra Grusvej.dk. \u201DDer skal g\xF8res noget effektivt for at skabe den n\xF8dvendige energi og holdbarhed i vejene, s\xE5 de kan holde i mange \xE5r frem p\xE5 trods af de stigende vandm\xE6ngder\u201D. <br data-v-7d70c62b><br data-v-7d70c62b> En af l\xF8sningerne er genopretning af de nuv\xE6rende grus- og jordveje. Grusvej.dk har udviklet flere processer som kan fremtidssikre vejene. Metoder som er b\xE5de effektive og klimavenlige. De gamle veje knuses p\xE5 stedet med tungt specialmaskineri for at findele fortidens nedlagte materialer, hvorefter vejen stabiliseres med kalk eller cement og der udl\xE6gges et mindre supplerende b\xE6relag/slidlag p\xE5 vejen. Til sidst komprimeres jorden og der tr\xE6kkes en korrekt profil ned over vejen, s\xE5 vandet naturligt ledes v\xE6k fra overfladen \u2013 eventuelt ud i anlagte regnvandsbassiner til opsamling. <br data-v-7d70c62b><br data-v-7d70c62b> I og med at processen foreg\xE5r med de eksisterende materialer \u201Don location\u201D er der ikke brug for at fragte r\xE5materialer til og fra. Det betyder sparede CO2 udledninger. Der er igennem tiden etableret gr\xF8fter og kanaler for afledning af vand i terr\xE6net p\xE5 mange steder, hvor vedligeholdelsen ikke har v\xE6ret n\xF8dvendig fordi grundvandet har st\xE5et lavt. <br data-v-7d70c62b><br data-v-7d70c62b> Med det forh\xF8jede grundvandsspejl og med de dystre udsigter som varsles i fremtiden, er der behov for at en del af de gamle afledningssystemer v\xE6kkes til live igen. Ofte er der ligeledes behov for at grave nye nedsivningsarealer og gr\xF8fter langs vejene, ligesom genopretningen kan g\xF8res helt komplet med st\xF8vbindingsmidlet Dustex. Midlet, som er et restprodukt fra papirproduktion, fuldst\xE6ndigt giftfrit og uden p\xE5virkning af naturen. Dustex g\xE5r i forbindelse med jord- og st\xF8vpartikler, og binder materialerne til en h\xE5rd og ultraholdbar overflade.</p><h5 data-v-7d70c62b>Manglen p\xE5 r\xE5stoffer</h5><p data-v-7d70c62b>Danmarks r\xE5stoffer er blevet knappe, vi skal spare eller finde p\xE5 nye l\xF8sninger. Stabilisering er en af de nye metoder som vil blive anvendt i fremtiden, p\xE5peger Lars- Henrik Jensen. <br data-v-7d70c62b><br data-v-7d70c62b> \u201DMed tilf\xF8rsel af kalk eller cement i r\xE5jorden \xF8ges b\xE6reevnen ligesom tilf\xF8rsel af cement eller ligning i bundsikrings- og b\xE6relaget reducerer forbruget af r\xE5stoffer og dermed reducerer vores co2 forbrug v\xE6sentligt.\u201D<br data-v-7d70c62b><br data-v-7d70c62b> \u201DVi skal g\xF8re os meget st\xF8rre tanker om at reducere vores Co2 og r\xE5stofforbrug n\xE5r det g\xE6lder vores mange grus- og jordveje. Vi st\xE5r lige nu midt i udfordringen - heldigvis med mulighed for at g\xF8re noget effektivt ved det\u201D, slutter Lars-Henrik Jensen fra Grusvej.dk</p></div><div class="w-full flex flex-col mt-10 sm:gap-20 gap-10 -translate-y-9" data-v-7d70c62b><img class="sm:h-auto h-[300px]" src="https://i.ibb.co/6Y7FG6t/vandfyldt-jordvej-60.webp" alt="" data-v-7d70c62b><img src="https://i.ibb.co/n05r7Wg/vej-planering-60.webp" alt="" data-v-7d70c62b></div></div></article></main></div><!--]-->`);
